// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;

contract InitBalance {
    uint public balance;
    address owner;

    constructor() payable {
        balance = msg.value;
        owner = payable(msg.sender);
    }

    function getBalance() public view returns (uint) {
        return address(this).balance;
    }

}

